import React, { Component, useState } from "react";

function Applications() {
  return (
    <section className="w-[100%] bg-[#F2F5F8] py-[40px]">
      <div className="w-full px-[6%]">
        <ApplicationTitle />
      </div>
    </section>
  );
}

class ApplicationTitle extends Component {
  constructor() {
    super();
    this.state = {
      Text: "یک اپلیکیشن، برای تمام نیازها",
    };
  }
  render() {
    return (
      <section className="flex justify-center w-full">
        <h2 className="text-[23px] md:text-[29px] lg:text-[33px] xl:text-[36px] font-semibold text-slate-700">
          {this.state.Text}
        </h2>
        <ApplicationItems />
      </section>
    );
  }
}

function ApplicationItems() {
  const [data, setdata] = useState([
    {
      Image: "",
      Title: "",
      Desc: "",
    },
    {
      Image: "",
      Title: "",
      Desc: "",
    },
    {
      Image: "",
      Title: "",
      Desc: "",
    },
    {
      Image: "",
      Title: "",
      Desc: "",
    },
    {
      Image: "",
      Title: "",
      Desc: "",
    },
    {
      Image: "",
      Title: "",
      Desc: "",
    },
  ]);
  return <section className="w-full flex flex-wrap"></section>;
}

export default Applications;
